import React from 'react'

function EntityForm(props) {
    const { entityHandelSubmit, selectedEntent, setEntetysVal, setShowSearch, entetyVal, setReponseSpecefic, reponseSpecefic } = props
    return (
        <form
            onSubmit={(e) => entityHandelSubmit(e, selectedEntent)}
            style={{
                zIndex: 10,
                width: "400px",
                position: "absolute",
                right: "80%",
                background: "#fff",
                padding: "5px 20px",
                display: "flex",
                flexDirection: "column",
                height: "250px",
                justifyContent: "space-around",
                top: "20px",
                border: "2px solid lightgray",
                borderRadius: "10px"
            }}>
            <label style={{
                fontFamily: "poppins",
                marginBottom: "10px",
                fontSize: "14px"
            }}>Entity</label>
            <input style={{
                padding: "8px",
                border: "2px solid lightgray",
                borderRadius: "5px",
                outline: "none"
            }} type="text" name="entity" autoComplete="off" onChange={(e) => { setEntetysVal(e.target.value); setShowSearch(true) }} value={entetyVal} />

            <label style={{
                fontFamily: "poppins",
                marginBottom: "10px",
                fontSize: "14px"
            }}>Response Specifique</label>
            <input style={{
                padding: "8px",
                border: "2px solid lightgray",
                borderRadius: "5px"
            }} type="text" name="responseSpecific" onChange={e => setReponseSpecefic(e.target.value)} value={reponseSpecefic} />

            <button type="submit" style={{
                border: "none",
                background: "transparent",
                padding: 0,
                margin: 0
            }}>
                <svg width={100} height={40} viewBox="0 0 100 40">
                    <g data-name="Groupe 1132" transform="translate(-1210 -782)">
                        <rect
                            data-name="Rectangle 1563"
                            width={100}
                            height={40}
                            rx={2}
                            transform="translate(1210 782)"
                            fill="#4080ff"
                        />
                        <text
                            transform="translate(1243 807)"
                            fill="#fff"
                            fontSize={14}
                            fontFamily="Poppins-SemiBold, Poppins"
                            fontWeight={600}
                        >
                            <tspan x={0} y={0}>
                                {"Save"}
                            </tspan>
                        </text>
                    </g>
                </svg>
            </button>

        </form>
    )
}

export default EntityForm
